import React, { useState } from 'react';
import MyProfile from './MyProfile';  // Import your MyProfile component
import Logout from './Logout';        // Import your Logout component

const Account = () => {
  const [selectedTab, setSelectedTab] = useState('profile');

  const handleTabClick = (tab) => {
    setSelectedTab(tab);
  };

  return (
    <div>
      <div>
        <button onClick={() => handleTabClick('profile')}>Profile</button>
        <button onClick={() => handleTabClick('logout')}>Logout</button>
      </div>
      {selectedTab === 'profile' && <MyProfile />}
      {selectedTab === 'logout' && <Logout />}
    </div>
  );
};

export default Account;
